macArchiveBinaryFile
	"Answer the binary contents of a StuffIt archive file containing the CodeWarrier project files for the virtual machine. You will need to use a StuffIt unpacking utility such as StuffIt Expander to unpack the file. The result will be a folder containing the project files."
	"To create the text for this method evaulate:
		| in out |
		in _ (FileStream oldFileNamed: 'projectArchive.sit') binary.
		out _ WriteStream on: (String new: 100000).
		out nextPutAll: '#('.
		[in atEnd] whileFalse: [out nextPutAll: in next printString; space].
		out skip: -1.
		out nextPutAll: ')'.
		in close.
		ParagraphEditor clipboardTextPut: out contents asText
	  and then do paste into this method."

